import React from 'react'
import "../user/Toggle.css"
export const Toggle=({handleChange,isChecked})=> {
  return (
    <div className='toggle-container'>
        <input 
        type="checkbox"
        id="check"
        className="toggle"
        onChange={handleChange}
        checked={isChecked}
        />
        <br/>
     <label htmlFor="check"></label>
    </div>
  )
}
